var tipuesearch = {"pages": [{'title': '協同產品設計實習', 'text': '組員: 40823101 林晏鈴 、 40823104 葉沛翎 \n 組員個人網站: 40823101 、 40823104 \n 小組網站: GitHub 、 CMSIMDE \n \n', 'tags': '', 'url': '協同產品設計實習.html'}, {'title': 'Topic', 'text': '', 'tags': '', 'url': 'Topic.html'}, {'title': 'W2', 'text': '今天確認主題為挖土機手臂結構， \n 動機為想 研究挖土機手臂構造及作動原理， \n 本周從AUTOCAD開始繪製2D圖檔，再利用SOLIDWORK繪製3D圖， \n 預計下周用 CoppeliaSim模擬測試及修改。 \n 參考資料: \n https://kknews.cc/zh-tw/news/nbx58m5.html \n 參考進度 \n 第一周:主題確認，AutoCAD及Solidworks檔案完成 \n 第二周: CoppeliaSim檔案修正及完成 \n 第三周:報告 \n \n AutoCAD圖檔: \n \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '本周組員完成零件圖的3D圖及零件圖的組配，並開始利用程式在coppeliasim進行模擬。 \n', 'tags': '', 'url': 'W3.html'}, {'title': 'Solidworks', 'text': 'Solidworks圖檔 \n 零件圖 \n 1.底座 \n \n \n 2.結構1: \n \n 3.結構2: \n \n 4.鏟子: \n \n 5.活塞1-1: \n \n 6.活塞1-2: \n \n 7.活塞1-3: \n \n 8.活塞2: \n \n 9.活塞2-1: \n \n 10.活塞2-2: \n \n 11.連桿1: \n \n 12.連桿2: \n \n 13.連接件1: \n \n 14.連接件2: \n \n 15:連接件3: \n \n \n 零件影片 \n   \n         \n 組合圖 \n \n 組合圖影片 \n \n', 'tags': '', 'url': 'Solidworks.html'}, {'title': 'coppeliasim', 'text': '將挖土機手臂的組合圖stl檔以coppeliasim作動測試 \n  (發現soildwork的組合圖轉為stl檔後會自動拆開,變成一個個零件stl檔,後來改成匯出成step檔後放入inventor,再轉成stl檔即可為完整的組合圖) \n 測試影片1:將組合件建立從屬關係,並在三個主動軸上添加虛擬軸,結果失敗,各零件四散 \n 結果1:失敗,各零件四散,疑似從屬關係不順 \n \n \n 測試影片2:重新建立組合件之從屬關係,並在各軸上增加虛擬軸以加強物件之間的約束 \n 結果2: 失敗,各零件四散,虛擬軸似乎和物件拘束關係無關 \n \n \n 測試影片3:以手動方式轉動虛擬軸 \n 結果3:失敗, 疑似因為我們的主題挖土機手臂需要多個零件互相約束,但coppeliasim只能以一個主動件配合多個從動件,無法讓一個零件既是主動件也是從動件,所以用程式作動時會出現零件約束不足,因此無法順利作動並且零件四散 \n', 'tags': '', 'url': 'coppeliasim.html'}, {'title': '報告', 'text': '協同產品設計與實習.pdf \n \n 上台報告 \n PDF: https://40823104.github.io/stage1-ag4/downloads/%E5%8D%94%E5%90%8C%E7%94%A2%E5%93%81%E8%A8%AD%E8%A8%88%E8%88%87%E5%AF%A6%E7%BF%92.pdf \n reveal: https://40823104.github.io/stage1-ag4/reveal/index.html \n 影片: \n \n 各組影片名稱更名及長度 \n https://drive.google.com/drive/folders/1n4L-tWhAaJEzP7O9FdyERihYsy7aEJ07?usp=sharing \n \n', 'tags': '', 'url': '報告.html'}]};